import React from "react";

function Card(props) {
  const { cartItems, setCartItems } = props;
  const addProduct = () => {
    setCartItems(cartItems + 1);
  };
  return (
    <div className="card">
      <div className="div-product-image"></div>
      <button className="btn-add" onClick={() => addProduct()}>
        Add
      </button>
    </div>
  );
}

export default Card;
